package com.mycompany.ClinicaOdontologica.model;import jakarta.persistence.Entity;import lombok.Getter;import lombok.Setter;import java.util.Date;@Getter@Setter@Entitypublic class Responsible extends Person{    private  String typeResponsibility;    public Responsible (){    }    public Responsible(Long idPerson, String dni, String name, String lastname, String phoneNumber, String address, Date birthdate, String typeResponsibility) {        super(idPerson, dni, name, lastname, phoneNumber, address, birthdate);        this.typeResponsibility = typeResponsibility;    }}